import './App.css';

function App() {
  const title = "Welcome to the new blog";
  const likes = 47;
  const person = {name: "Matias", age:18}

  return (
    <div className="App">
      <div className="content"> 
        <h1> {title} </h1>
        <p> Liked {likes} times </p>
        <p>Name: {person.name}</p>
      </div>

    </div>
  );
}

export default App;
